var starConfig = {
  starWidth: '20px',
  ratedFill: '#ffb649',
  rating: 4.2,
  readOnly: true
}

jQuery(document).ready(function($) {
	// initialize stars
	$('.rateYo').rateYo(starConfig)

	$('.time-picker').mdtimepicker()
	
	var timeout = null

	$(".minimal-card-wrap").mousemove(function(e) {
		clearTimeout(timeout);
		var wrap = $(this)
		var card = $(this).find(".minimal-card")
		var avatar = $(this).find(".avatar")

	    timeout = setTimeout(function(){
		    var main = e.target.getBoundingClientRect()
		 	var x = e.pageX - wrap.offset().left - main.width / 2;
			var y = e.pageY - wrap.offset().top - main.height / 2;
			card.css({"transform":"translate("+(x/50)+"%,"+(y/50)+"%) perspective(1500px) rotateX("+-y/50+"deg) rotateY("+x/50+"deg) scale(1.1)"});
			avatar.css({"transform":"translate("+(x/50-50)+"%,"+(y/50-50)+"%) perspective(1500px) rotateX("+-y/50+"deg) rotateY("+x/50+"deg) scale(0.8)"});
		}, 1)
			
	  
	});


	$(".minimal-card-wrap").mouseleave(function() {
		clearTimeout(timeout);
		var card = $(this).find(".minimal-card")
		var avatar = $(this).find(".avatar")
		card.css({"transform":"scale(1)"});
		avatar.css({"transform":"translate3d(-50%,-50%,10px) scale(0.75)"});
	});

	$('#arroundScheduleBtn').click(function () {
		$(this).toggleClass('active')
		$('.schedule-popup-wrap').toggleClass('d-none')
	})
})
;
function onCoinOrSubscriptionClick (type, event) {
	var iterator

	if (type === 'subscription') {
		iterator = $('.subscriptions .subscription')
	} else {
		iterator = $('.coins .coin')
	}

	iterator.removeClass('active')

	$(event.currentTarget).closest('.' + type).addClass('active')
}

function showPreCheckout(amount, total,id) {
	$('#preCheckoutAmount').text(amount)
	$('#preCheckoutTotal').text(total)
	$('.checkout-button').attr('id',id)
	$('#preCheckoutDialog').modal()
}

jQuery(document).ready(function($) {
	$('.subscriptions .subscription button').click(function (event) {
		onCoinOrSubscriptionClick('subscription', event)
		showPreCheckout($(this).attr('data-amount'), $(this).attr('data-total'),$(this).attr('stripe-id'))

	})

	$('.coins .coin button').click(function (event) {
		onCoinOrSubscriptionClick('coin', event)

		showPreCheckout($(this).attr('data-amount'), $(this).attr('data-total'),$(this).attr('stripe-id'))
	})

	$('#postCheckoutFailedDialog').on('hidden.bs.modal', function (e) {
  		$('#postCheckoutFailedDialog .failed-container').addClass('d-none')
	})
	$('#postCheckoutFailedDialog').on('shown.bs.modal', function (e) {
		$('#postCheckoutFailedDialog .failed-container').removeClass('d-none')
	})

	$('#postCheckoutSuccessDialog').on('hidden.bs.modal', function (e) {
		$('#postCheckoutSuccessDialog .success-container').addClass('d-none')
	})

	$('#postCheckoutSuccessDialog').on('shown.bs.modal', function (e) {
		$('#postCheckoutSuccessDialog .success-container').removeClass('d-none')
	})
})
;
jQuery(document).ready(function($){
    var $form_modal = $('.cd-user-modal'),
        $form_login = $form_modal.find('.gridSign'),
        $form_signup = $form_modal.find('#cd-signup'),
        $form_forgot_password = $form_modal.find('.gridForgot'),
        $form_modal_tab = $('.cd-switcher'),
        $tab_login = $form_modal.find('.sign-in-btn')// $form_modal_tab.children('li').eq(0).children('a'),
        $tab_signup = $form_modal.find('.sign-up-btn') // $form_modal_tab.children('li').eq(1).children('a'),
        $forgot_password_link = $form_login.find('.cd-form-bottom-message a'),
        $back_to_login_link = $form_forgot_password.find('.cd-form-bottom-message a'),
        // $main_nav = $('.site-navigation');
        $main_nav = $('.cd-signin');

    var currentActiveColumn = 'sign-in'
    //open modal
    $main_nav.on('click', function(event){
        $("body").addClass("scroll-fix");
        $form_modal.addClass('is-visible');

        if (currentActiveColumn === 'sign-up') {
            signup_selected()
            setTimeout(focusOnfirstInputInSignUp, 700)
        } else {
            login_selected();
            setTimeout(focusOnfirstInputInSignIn, 700)
        }
    });

    //close modal
    function closeDialog () {
        $form_modal.removeClass('is-visible');
        $("body").removeClass("scroll-fix");
    }
    $('.cd-user-modal').on('click', function(event){
        if( $(event.target).is($form_modal)) {
            closeDialog()
        }
    });

    $('.cd-close-form').on('click', function (event) {
       closeDialog()
    })
    //close modal when clicking the esc keyboard button
    $(document).keyup(function(event){
        if(event.which=='27'){
            closeDialog()
        }
    });

    //switch from a tab to another
    $form_modal_tab.on('click', function(event) {
        event.preventDefault();
        ( $(event.target).is( $tab_login ) ) ? login_selected() : signup_selected();
    });

    //hide or show password
    $('.hide-password').on('click', function(){
        var $this= $(this),
            $password_field = $this.prevAll('input');
        ( 'text' == $password_field.attr('type') ) ? $password_field.attr('type', 'password') : $password_field.attr('type', 'text');
        ( 'Show' == $this.text() ) ? $this.text('Hide') : $this.text('Show');
        //focus and move cursor to the end of input field
        $password_field.putCursorAtEnd();
    });

    //show forgot-password form
    $forgot_password_link.on('click', function(event){
        event.preventDefault();
        forgot_password_selected();
    });

    //back to login from the forgot-password form
    $back_to_login_link.on('click', function(event){
        event.preventDefault();
        login_selected();
    });

    function login_selected(){
        $form_signup.addClass('hide');
        $form_forgot_password.addClass('hide');
        $form_forgot_password.removeClass('topLevel');
        $form_login.removeClass('hide');
        setTimeout(function(){
            $form_login.addClass('topLevel');
          },15);
    }

    function hideForgotForm(){
        $form_forgot_password.addClass('hide');
        $form_forgot_password.removeClass('topLevel');
    }

    function signup_selected(){
        $form_login.removeClass('is-selected');
        $form_signup.addClass('is-selected');
        $form_forgot_password.removeClass('is-selected');
    }

    function forgot_password_selected(){
        $form_login.addClass('hide');
        $form_login.removeClass('topLevel');
        $form_forgot_password.removeClass('hide');
        setTimeout(function(){
            $form_forgot_password.addClass('topLevel');
          },15);
    }

    // //REMOVE THIS - it's just to show error messages
    // $form_login.find('input[type="submit"]').on('click', function(event){
    //     event.preventDefault();
    //     $form_login.find('input[type="email"]').toggleClass('has-error').next('span').toggleClass('is-visible');
    // });
    // $form_signup.find('input[type="submit"]').on('click', function(event){
    //     event.preventDefault();
    //     $form_signup.find('input[type="email"]').toggleClass('has-error').next('span').toggleClass('is-visible');
    // });


    //IE9 placeholder fallback
    //credits http://www.hagenburger.net/BLOG/HTML5-Input-Placeholder-Fix-With-jQuery.html
    if(!Modernizr.input.placeholder){
        $('[placeholder]').focus(function() {
            var input = $(this);
            if (input.val() == input.attr('placeholder')) {
                input.val('');
            }
        }).blur(function() {
            var input = $(this);
            if (input.val() == '' || input.val() == input.attr('placeholder')) {
                input.val(input.attr('placeholder'));
            }
        }).blur();
        $('[placeholder]').parents('form').submit(function() {
            $(this).find('[placeholder]').each(function() {
                var input = $(this);
                if (input.val() == input.attr('placeholder')) {
                    input.val('');
                }
            })
        });
    }


    // new animation
    // listeners
    $('.sign-up-btn').on('click', function() {
      toggleColumns('sign-up')
    });

    $('.sign-in-btn').on('click', function() {
      toggleColumns('sign-in')
    });

    function focusOnfirstInputInSignIn () {
        var firstInput = document.querySelector('.sign-in-email')
        if (firstInput) firstInput.focus()
    }
    function focusOnfirstInputInSignUp () {
        var firstInput = document.querySelector('#user_firstname')
        if (firstInput) firstInput.focus()
    }

        setTimeout(function(){
          var grid = document.querySelector('.gridCreate');
          if(grid)
          {
            grid.classList.add('topLevel');
          }

        },15);

          const btnsign = document.querySelector('#forSignUpButton');

          if(btnsign!= null)
          {
            btnsign.addEventListener('click', switchToFormRegister);
          }



        function switchToFormRegister() {
          toggleColumns('sign-in');
          /*var grid_form = document.querySelector('.grid_form');
          grid_form.classList.add('grid_form2');*/
          var circleBlue = document.querySelector('.circleBlue');

          if(circleBlue)
          {
            circleBlue.classList.remove('growBlue');
          }


          var circleGreen = document.querySelector('.circleGreen');
          if (circleGreen)
          {
            circleGreen.classList.add('growGreen');
          }

          var messageGreen = document.querySelector('.messageGreen');
          if(messageGreen)
          {
            messageGreen.classList.add('hide');
          }

          var gridHola = document.querySelector('.gridSign');

          if(gridHola)
          {
            gridHola.classList.remove('hide');
          }


          var messageBlue = document.querySelector('.messageBlue');
          if(messageBlue)
          {
            messageBlue.classList.remove('hide');
          }

          var grid = document.querySelector('.gridCreate');
          if (grid)
          {
            grid.classList.add('hide');
            grid.classList.remove('topLevel');
          }

          login_selected();

          setTimeout(function(){
            if (gridHola)
            {
                gridHola.classList.add('topLevel');
            }

          },15);
        }

        const btnSignIn = document.querySelector('#forSignInButton');
        if(btnSignIn)
        {
          btnSignIn.addEventListener('click', switchToFormSignIn);
        }


        function switchToFormSignIn() {
          toggleColumns('sign-up');
          hideForgotForm();
          /*var grid_form = document.querySelector('.grid_form');
          grid_form.classList.remove('grid_form2');*/
          var menu = document.querySelector('.circleBlue');
          menu.classList.add('growBlue');

          var circleGreen = document.querySelector('.circleGreen');
          circleGreen.classList.remove('growGreen');

          var messageGreen = document.querySelector('.messageGreen');
          messageGreen.classList.remove('hide');

          var gridHola = document.querySelector('.gridSign');
          gridHola.classList.add('hide');
          gridHola.classList.remove('topLevel');


          var messageBlue = document.querySelector('.messageBlue');
          messageBlue.classList.add('hide');
          var grid = document.querySelector('.gridCreate');
          grid.classList.remove('hide');

          setTimeout(function(){
            grid.classList.add('topLevel');
          },15);

        }
        switchToFormRegister();
    // methods
    function toggleColumns (activeColumn) {
        currentActiveColumn = activeColumn
        if (activeColumn === 'sign-up') {
            signup_selected()
            focusOnfirstInputInSignUp()

            $('.sign-up-wrap').removeClass('small').addClass('expand')

            $('.sign-in-wrap').removeClass('expand').addClass('small')

            $('.sign-in .content .section-description').removeClass('hide').addClass('show');
            $('.sign-up .content .section-description').removeClass('show').addClass('hide');

            $('.sign-up').removeClass('deactive').addClass('active')
            $('.sign-in').removeClass('active').addClass('deactive')

            $('.sign-up .hidden-content').removeClass('hide').addClass('show');
            $('.sign-in .hidden-content').removeClass('show').addClass('hide');
        } else {

            focusOnfirstInputInSignIn()

            $('.sign-in-wrap').removeClass('small').addClass('expand')
            $('.sign-up-wrap').removeClass('expand').addClass('small')

            $('.sign-up .content .section-description').removeClass('hide').addClass('show')
            $('.sign-in .content .section-description').removeClass('show').addClass('hide')

            $('.sign-in').removeClass('deactive').addClass('active')
            $('.sign-up').removeClass('active').addClass('deactive')

            $('.sign-in .hidden-content').removeClass('hide').addClass('show')
            $('.sign-up .hidden-content').removeClass('show').addClass('hide');
        }
    }

    // validations
    $('#reset-password-form, #sign-in-form').each(function() {  // attach to all form elements on page
        $(this).validate({
            submitHandler: function(form) {
              form.submit()
            }
        })
    })

    $('#sign-up-form').validate({
        rules: {
            'user[password_confirmation]': {
              equalTo: '#sign-up-form [name="user[password]"]'
            }
        },
        messages: {
            'user[password_confirmation]': {
                equalTo: 'Password and confirm password does not match.'
            }
        },
        submitHandler: function(form) {
            form.submit()
        }
    })

    // password strength meter
    function passwordMeter (password) {
        let strengthValue = {
            'caps': false,
            'length': false,
            'special': false,
            'numbers': false,
            'small': false
        };

        if(password.length >= 8) {
            strengthValue.length = true;
        }

        for(let index=0; index < password.length; index++) {
            let char = password.charCodeAt(index);
            if(!strengthValue.caps && char >= 65 && char <= 90) {
                strengthValue.caps = true;
            } else if(!strengthValue.numbers && char >=48 && char <= 57){
                strengthValue.numbers = true;
            } else if(!strengthValue.small && char >=97 && char <= 122){
                strengthValue.small = true;
            } else if(!strengthValue.numbers && char >=48 && char <= 57){
                strengthValue.numbers = true;
            } else if(!strengthValue.special && (char >=33 && char <= 47) || (char >=58 && char <= 64)) {
                strengthValue.special = true;
            }
        }

        let strengthIndicator = 0;

        for (let metric in strengthValue) {
            if(strengthValue[metric] === true) {
                strengthIndicator++;
            }
        }

        return strengthIndicator
    }

    var password = document.querySelector('#sign-up-form [name="user[password]"]');
    var text = document.getElementById('password-strength-text');

    let strength = {
        0: '<span style="color: #CC0000">Not Secure</span>',
        1: '<span style="color: #ff4444">Weak</span>',
        2: '<span style="color: #ffbb33">Fair</span>',
        3: '<span style="color: #00C851">Good</span>',
        4: '<span style="color: #007E33">Strong</span>'
    };

    if (password)
    {
      password.addEventListener('keyup', function() {
          var val = password.value
          var score = passwordMeter(val)

          // Update the text indicator
          if (val !== "") {
              password.classList.add('has-strength')

              text.innerHTML = "PW strength: " + strength[score];
          } else {
              password.classList.remove('has-strength')

              text.innerHTML = "";
          }
      });
    }

});




